import React from 'react';
import './Table.css';
import { useState } from 'react';

const FormButton = () => {
  const [isOpen, setIsOpen] = useState(false);

  const handleClick = () => {
    setIsOpen(true);
  };

  return (
    <div>
      {!isOpen && (
        <button onClick={handleClick}>Open Form</button>
      )}

      {isOpen && (
        <form>
          {/* Your form fields and components */}
          <input type="text" placeholder="Name" />
          <input type="email" placeholder="Email" />
          {/* ... other form fields */}
          <button type="submit">Submit</button>
        </form>
      )}
    </div>
  );
};

const TableComponent1 = () => {
  const tableStyle = {
    border: '1px solid black',
    borderCollapse: 'collapse',
    position:'relative',
    fontSize: "12px",
    fontWeight:"500"

  };

  const cellStyle = {
    border: '1px solid black',
    padding: '3px',
    width:"100px",

  };
  const Rake_ID_Style = {
    border: '1px solid black',
    padding: '3px',
    width:"115px"
  };
  const Rake_Name_Style = {
    border: '1px solid black',
    padding: '3px',
    width:'190px'
  };
  const Commodity_Style = {
    border: '1px solid black',
    padding: '3px',
    width:'250px'
  };

  return (
    <table style={tableStyle}>
      <thead>
        <tr className="tableRow">
          <th style={cellStyle}>#</th>
          <th style={Rake_Name_Style}>Rake Name</th>
          <th style={Rake_ID_Style}>Rake ID</th>
          <th style={Commodity_Style}>Commodity</th>
          <th style={cellStyle}>Action</th>
        </tr>
      </thead>
      <tbody>
        <tr className="tableRow">
          <td style={cellStyle}>1</td>
          <td style={cellStyle}>JSPK-174</td>
          <td style={cellStyle}>R202209281118071748989</td>
          <td style={cellStyle}>PLATE,</td>
          <td style={cellStyle}><button className='Eye_Button'><ion-icon name="eye"></ion-icon></button>
          <button className='Form_Button' onClick={FormButton}><ion-icon name="reader"></ion-icon></button>
          </td>
        </tr>
        <tr className="tableRow">
          <td style={cellStyle}>2</td>
          <td style={cellStyle}>FAULAD E</td>
          <td style={cellStyle}>R202211301912051426466</td>
          <td style={cellStyle}>BILLET,</td>
          <td style={cellStyle}><button className='Eye_Button'><ion-icon name="eye"></ion-icon></button>
          <button className='Form_Button'><ion-icon name="reader"></ion-icon></button>
          </td>
        </tr>
        <tr className="tableRow">
          <td style={cellStyle}>3</td>
          <td style={cellStyle}>BRN E</td>
          <td style={cellStyle}>R202212021056221804649</td>
          <td style={cellStyle}>,</td>
          <td style={cellStyle}><button className='Eye_Button'><ion-icon name="eye"></ion-icon></button>
          <button className='Form_Button'><ion-icon name="reader"></ion-icon></button>
          </td>
        </tr>
        
      </tbody>
    </table>
  );
};

export default TableComponent1;
